import React from 'react';

const Note = ({ note, setCurrentNote }) => {
    return (
        <div className={`note ${note.category}`}>
            <h2>{note.title}</h2>
            <p>{note.content}</p>
            <button onClick={() => setCurrentNote(note)}>Editar</button>
            <button onClick={() => deleteNote(note.id)}>Eliminar</button>
        </div>
    );
};

export default Note;
